<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">

    <style>
        body {
            margin: 0;
            background-color: #2c2c2e;
            font-family: Arial, Helvetica, sans-serif;
            color: #33FF33;
            display: flex;
            flex-direction: column;
            justify-content: center;
            align-items: center;
            height: 100vh;
            overflow: hidden;
        }

        button {
            margin-top: 20px;
            padding: 10px 20px;
            font-size: 20px; 
            color: white;
            background-color: #333;
            border: 2px solid #33FF33;
            border-radius: 8px;
            cursor: pointer;
            transition: background-color 0.3s ease;
        }

        button:hover {
            background-color: #444;
        }

        #background-video {
    position: fixed;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    object-fit: cover;
    z-index: -1;
}

        #info {
            font-size: 16px;
            text-align: center;
            margin-top: 20px;
            color: #33FF33;
            display: none;
        }

        .info-line {
            margin: 5px 0;
        }

  
        @media (max-width: 768px) {
            body {
                font-size: 14px; 
            }

            #info {
                font-size: 14px; 
            }

            button {
                font-size: 16px;
                padding: 8px 16px;
            }
        }
        @media (max-width: 768px) {
    #background-video {
        position: absolute;
        width: 100%;
        height: auto; 
        top: 50%;
        left: 50%;
        transform: translate(-50%, -50%);
    }
}
    </style>
</head>
